write_file({'path': 'app/backend/server.js', 'content': "import dotenv from 'dotenv';
import express from 'express';
import cors from 'cors';
import morgan from 'morgan';

import healthRoutes from './src/routes/health.js';
import authRoutes from './src/routes/auth.js';
import locationsRoutes from './src/routes/locations.js';
import flightsRoutes from './src/routes/flights.js';
import hotelsRoutes from './src/routes/hotels.js';
import carsRoutes from './src/routes/cars.js';
import packagesRoutes from './src/routes/packages.js';
import cartRoutes from './src/routes/cart.js';
import bookingsRoutes from './src/routes/bookings.js';

import { notFoundHandler, errorHandler } from './src/middleware/error.js';

dotenv.config();

const app = express();

app.use(
  cors({
    origin: process.env.CORS_ORIGIN?.split(',') ?? ['http://localhost:8005'],
    credentials: true
  })
);
app.use(express.json({ limit: '1mb' }));
app.use(morgan('dev'));

app.use('/health', healthRoutes);
app.use('/auth', authRoutes);
app.use('/api/locations', locationsRoutes);
app.use('/api/flights', flightsRoutes);
app.use('/api/hotels', hotelsRoutes);
app.use('/api/cars', carsRoutes);
app.use('/api/packages', packagesRoutes);
app.use('/api/cart', cartRoutes);
app.use('/api/bookings', bookingsRoutes);

app.use(notFoundHandler);
app.use(errorHandler);

const PORT = process.env.PORT || 8082;
app.listen(PORT, () => {
  // eslint-disable-next-line no-console
  console.log(`Backend listening on :${PORT}`);
});
"})

