write_file({'path': 'app/backend/src/utils/pagination.js', 'content': 'export function parsePagination(query, defaults = { limit: 20, offset: 0 }, maxLimit = 100) {
  const limitRaw = query.limit ?? defaults.limit;
  const offsetRaw = query.offset ?? defaults.offset;

  const limit = Math.min(Math.max(parseInt(limitRaw, 10) || defaults.limit, 1), maxLimit);
  const offset = Math.max(parseInt(offsetRaw, 10) || defaults.offset, 0);

  return { limit, offset };
}
