write_file({'path': 'app/backend/src/db.js', 'content': "import pg from 'pg';
import dotenv from 'dotenv';

dotenv.config();

const { Pool } = pg;

const pool = new Pool({
  connectionString: process.env.DATABASE_URL,
  host: process.env.PGHOST,
  port: process.env.PGPORT ? Number(process.env.PGPORT) : undefined,
  user: process.env.PGUSER,
  password: process.env.PGPASSWORD,
  database: process.env.PGDATABASE,
  ssl: process.env.PGSSLMODE === 'require' ? { rejectUnauthorized: false } : undefined
});

export async function query(text, params) {
  return pool.query(text, params);
}

export async function withClient(fn) {
  const client = await pool.connect();
  try {
    return await fn(client);
  } finally {
    client.release();
  }
}

export default pool;
"})

write_file({'path': 'app/backend/src/middleware/error.js', 'content': "import { sendError } from '../utils/response.js';

export function notFoundHandler(req, res) {
  return sendError(res, 404, 'NOT_FOUND', `Route not found: ${req.method} ${req.originalUrl}`);
}

// eslint-disable-next-line no-unused-vars
export function errorHandler(err, req, res, next) {
  const status = err.status || 500;
  const code = err.code || (status >= 500 ? 'INTERNAL_ERROR' : 'REQUEST_ERROR');
  const message = err.message || 'Unexpected error';

  if (status >= 500) {
    // eslint-disable-next-line no-console
    console.error(err);
  }

  return sendError(res, status, code, message, err.details);
}
"})

write_file({'path': 'app/backend/src/middleware/auth.js', 'content': "import jwt from 'jsonwebtoken';
import { sendError } from '../utils/response.js';

export function requireAuth(req, res, next) {
  const header = req.headers.authorization;
  if (!header) return sendError(res, 401, 'UNAUTHORIZED', 'Missing Authorization header');

  const [prefix, token] = header.split(' ');
  if (prefix !== 'Bearer' || !token) {
    return sendError(res, 401, 'UNAUTHORIZED', 'Invalid Authorization header format');
  }

  try {
    const payload = jwt.verify(token, process.env.JWT_SECRET || 'dev_secret');
    req.user = payload;
    return next();
  } catch (e) {
    return sendError(res, 401, 'UNAUTHORIZED', 'Invalid or expired token');
  }
}
"})

